import React, {Component} from 'react'
import styles from './QuizList.module.css'

export default class QuizList extends Component {

    renderQuizes() {
        return [1,2,3]
    }

    render() {
        return (
            <div className={styles.QuizList}>
                <h1>Список тестов</h1>

                    <ul>
                        { this.renderQuizes() }
                    </ul>
            </div>
        )
    }
}
